import axios from "axios";
import {appConstants} from "../constants/constant";

const API = 'http://localhost:8089';

export const test111 = () =>
{
    const testPromise = axios.get(`${API}/applications`);
    console.log(testPromise)
    return{
        type:"GET_APPS111",
        payload:testPromise,
    };

}
